// Importing Requried Modules :
import React from 'react';
import { Route, Switch } from 'react-router-dom'

// Importing Requried Components :
import Navbar from './Navbar'
import Home from './Home'
import Services from './Services'
import About from './About'
import Contact from './Contact'
import Error from './Error'
import Foot from './Footer'

// Importing CSS :
import './index.css'



    // To Getting the Data from the URL use colon ':' & pass a Variable (Parameter).
const App = () => {

    // Rendering :
    return (
        <>
            <Navbar />
            <div className="box">
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route path="/services" component={Services} />
                        {/* 'name' is the parameter which has the url data (entered by the user) */}
                            {/* It also have the default argument , given in the NavBar */}
                        {/* If you want to get more parameter than simply add a new variable with '/:' */}
                    <Route exact path="/about" component={About} />
                    <Route path="/about/:name/:id" component={About} />
                    <Route path="/contact" component={Contact} />
                    <Route component={Error} />
                </Switch>
            </div>
            <Foot />
        </>
    )
}


// Exporting Component App :
export default App;
